import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Dashboard from './pages/Dashboard';
import NewProject from './pages/NewProject';
import Results from './pages/Results';

function App() {
  return (
    <Router>
      <div className="App">
        <nav style={{ padding: '15px', background: '#333', color: 'white', display: 'flex', gap: '20px' }}>
          <Link to="/" style={{ color: 'white', textDecoration: 'none' }}>Sarcini Evaluare</Link>
          <Link to="/new-project" style={{ color: 'white', textDecoration: 'none' }}>AdaugÄƒ Proiect</Link>
          <Link to="/results" style={{ color: 'white', textDecoration: 'none' }}>Clasament / Rezultate</Link>
        </nav>

        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/new-project" element={<NewProject />} />
          <Route path="/results" element={<Results />} />
        </Routes>
      </div>

    </Router>
  );
}

export default App;
